(7, NULL, 'Rashid Hussain', 'rashidnuf@gmail.com', '00971502103212', 'Nadeem & Umendra Chartered Accountants (NUF)', NULL, '9', '85', '2012', '-fdedac6bfc69e2d233d1180abd112ebc.pdf', '-3893ff267b2d9e7c8d261cc765fe92a7.pdf', '-abe93be392befe520f984c9a8a6c7882.pdf', '', 'NUF Chartered Accountants has more than 10 years of experience. We are registered in all free zones in UAE. Our Audit reports are accepted almost in all banks. We are providing auditing/accounting/VAT/Corporate Tax\r\nand number of other financial services.', 'Audit Reports, Liquidation Reports, Sales letters for shops in Malls', 'Accounting services', 'VAT services/ VAT registration/VAT returns quarterly', 'Corporate Tax services/UBO/Financial Due Diligence/Point of sale', 'ICV Certification/Business Feasibility/ESR Services', 'Company Formation Services', '510', '5th', 'A khaleej Centre', 'Al mankhool Street', '3', '321', '00971502103212', 'rashid@nufcauae.ae', '00971502103212', '00971502103212', 'https;//web .facebook.com/nufcharteretaccountantsdubai', 'Bur Dubai', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2022-03-09 19:33:45', '2022-03-09 19:33:45'),
(8, 'Owner', 'Shakti Patel', 'info@britishlaundryuae.com', '971581209837', 'British Laundry', NULL, '12', '107', '2021', '-19679d2baca627a4276218a03aef20f7.jpg', '-19679d2baca627a4276218a03aef20f7.pdf', '-19679d2baca627a4276218a03aef20f7.pdf', '', '\"When looking for a cleaner, we all desire high-quality care, fair costs, and excellent service. But it\'s also good to have someone who knows you and your clothes intimately. British laundry is professional garment care, cleaning, and finishing service that caters to both retail and corporate wardrobes of men, women, and children, as well as providing dry-cleaning, Laundry services to companies such as hotels, institutions, and so on. British laundry provides high-quality service by merging cutting-edge technology with ecologically friendly equipment. We have a staff of Dry-cleaning specialists with decades of expertise to handle your clothing. Reduce the environmental effect of our activities via innovation, technology.\"', 'Laundry', 'Dry-cleaning', 'Shoes Cleaning', 'Carpet Cleaning', 'Curtains Cleaning', 'Corporate laundry', NULL, NULL, NULL, NULL, '3', NULL, '971581209837', 'info@britishlaundryuae.com', '971581209837', '971581209837', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2022-03-10 04:08:08', '2022-03-10 04:08:08'),
