(12, 'Owner', 'Abdul Wahab Jaleel', 'abdul.wahab@nexcurepharma.com', '0504509242', 'Nexcure Pharma', NULL, '8', '67', '2022', '', '', '', '', 'We are pharmaceutical company trading in nutraceutical and pharmaceutical products.   Our main categories can be classified. \r\n\r\n1. Nutraceutical\r\n2.  Grooming \r\n3. Pharmaceutical', 'Nutraceutical Products Trading', 'Grooming Products Trading', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', '978', '0504509242', 'abdul.wahab@nexcurepharma.com', '0504509242', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2022-03-23 15:03:59', '2022-03-23 15:03:59'),
