(14, 'Manager', 'Raj', 'intelligadgets.in@gmail.com', '+971585933899', 'Virtue Group LLC', NULL, '130', '84', '2021', '-f09ca90a196faa00a31635c33f5b0f45.png', '-f09ca90a196faa00a31635c33f5b0f45.pdf', '', '', 'VIRTUE GROUP LLC is a group of companies having subsidiaries namely IntelliGadgets, ICE-SoftTech and TrendzN’styles. The company specializes in General Trading, E-Commerce and Consultancy Services\r\n\r\nIntelliGadgets deals with sourcing and trading of different kinds of monitoring, measurement, communication and specialized devices, instruments and equipment for industrial, automotive, office and home use with IoT and other connectivity options for monitoring data via internet worldwide or local networks.\r\n\r\nICE-SoftTech deals with consultancy services for design and development of IoT products, Web Dashboards etc. using different communication protocols and state-of-the-art technologies.\r\nTrendzN’styles deals with wholesale and retail trading of apparels and accessories for Men, Women and Children. \r\n\r\nThe company having its office in Dubai, UAE, targets customers worldwide. The products are sold through our own websites and also through third party websites like Amazon, eBay etc.\r\nOur intent is to provide the community with unique products which they would normally purchase at a higher price. The company’s share holders handling different activities has vast experience in their respective fields, and are focused in providing customised products and services at the best rates.\r\n\r\nWe encourage customers to be experimental with new products. Our mission is to understand what our customers\' needs and hopes are, after buying our products for different fields and purposes.\r\n\r\nOur products and their specifications are carefully chosen by analysing market demand and comparing products from several suppliers to provide our customers with the best quality and reliable products. We also work with our suppliers to customize products for our customers, where possible, to provide them the best buying experience and satisfaction.', 'Smart Home Products for Home / Office Automation - Supply and Installation', NULL, NULL, NULL, NULL, NULL, NULL, '20', 'Aspin Commercial Tower', 'Sheikh Zayed Road', '3', NULL, '+971585933899', 'info@virtuegroupuae.com', '+971585933899', NULL, 'https://www.facebook.com/IntelliGadgets-107915281578257', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2022-03-25 00:48:58', '2022-03-25 00:48:58');
