INSERT INTO `email_templates` (`id`, `subject`, `body_json`, `body_html`, `status`, `created_at`, `updated_at`) VALUES
(5, 'Invitation For Business Proposal', '{\"ops\":[{\"insert\":\"Dear Sir/Madam,\\n\\nMy name is Muhammad firstly I want to introduce our Company Sahaa. me.\\n\"},{\"attributes\":{\"underline\":true,\"bold\":true},\"insert\":\"Introduction about Sahaa: \"},{\"insert\":\"\\nSahaa.me is the U.A.E leading Media & Marketing Company. Our website launched in U.A.E in 2022. Our services are Marketing, Branding, Business Directory, and website, software & applications development.\\n\"},{\"attributes\":{\"underline\":true,\"bold\":true},\"insert\":\"Why is marketing important for your Business?\"},{\"insert\":\"\\nAs we know, Marketing is the crucial element of every brand company. Marketing informs your customers about the products or services you\'re offering them.\\nThrough marketing, the customers get to know about the value of the products, their usage, and additional info that might be helpful to the customers. It creates brand awareness and makes the Business stand out.\\nThrough communication, marketing helps your Business become a market leader.\\n\\n\"},{\"attributes\":{\"underline\":true,\"bold\":true},\"insert\":\"Proposal:\"},{\"insert\":\"\\nThe purpose of this proposal is to give you the chance to increase your Sales, Reputation, Audience, and Trust. In addition, our Company will invest in your Business by advertising your Brand, Product & Service for free throughout the year 2022. Furthermore, we will represent & promote your Business on famous Digital platforms by using Organic & Paid Marketing Services.\\n \\nFor this, I invite you for a short meeting over Zoom or Google meet. By clicking this link, you can inform us about the right time to speak. Link : https://sahaa.me/schedual-call\\n& also, I\'m sharing my contact details where you can inform me about a convenient time to speak with each other.\\n\\nContact Details\\nName: Muhammad Khan\\nMob: 0543512089\\nWhatsapp number: 0543512089\\nEmail: Muhammad@sahaa.me\\n\\nThanks,\\nMuhammad Khan \\n\\n\\n\\n\"}]}', '<p>Dear Sir/Madam,</p><p><br></p><p>My name is Muhammad firstly I want to introduce our Company Sahaa. me.</p><p><strong><u>Introduction about Sahaa: </u></strong></p><p>Sahaa.me is the U.A.E leading Media & Marketing Company. Our website launched in U.A.E in 2022. Our services are Marketing, Branding, Business Directory, and website, software & applications development.</p><p><strong><u>Why is marketing important for your Business?</u></strong></p><p>As we know, Marketing is the crucial element of every brand company. Marketing informs your customers about the products or services you\'re offering them.</p><p>Through marketing, the customers get to know about the value of the products, their usage, and additional info that might be helpful to the customers. It creates brand awareness and makes the Business stand out.</p><p>Through communication, marketing helps your Business become a market leader.</p><p><br></p><p><strong><u>Proposal:</u></strong></p><p>The purpose of this proposal is to give you the chance to increase your Sales, Reputation, Audience, and Trust. In addition, our Company will invest in your Business by advertising your Brand, Product & Service for free throughout the year 2022. Furthermore, we will represent & promote your Business on famous Digital platforms by using Organic & Paid Marketing Services.</p><p> </p><p>For this, I invite you for a short meeting over Zoom or Google meet. By clicking this link, you can inform us about the right time to speak. Link : https://sahaa.me/schedual-call</p><p>& also, I\'m sharing my contact details where you can inform me about a convenient time to speak with each other.</p><p><br></p><p>Contact Details</p><p>Name: Muhammad Khan</p><p>Mob: 0543512089</p><p>Whatsapp number: 0543512089</p><p>Email: Muhammad@sahaa.me</p><p><br></p><p>Thanks,</p><p>Muhammad Khan </p><p><br></p><p><br></p><p><br></p>', 1, '2022-02-15 14:40:04', '2022-02-26 20:51:24');
